Magical books To start off, I added the book that spawns in a random position above the player upon challenge initiation. It consists of a simple book mesh and a script handling its movement. The book's movement depends on how the player interacts with it. It has multiple states that decide how and where the book moves: Idle Attracted Grabbed Rotated Finished The book's movement is handled by differentiating these movement modes and setting its target position and way of traversal accordingly. Without any interaction by the player, the book moves in a circle above the player's head. This is achieved by setting the target position to the next step on the circle using basic trigonometry. The book does so uniformly , which means that it uniformly moves towards this position, resulting in even movement without sudden velocity shifts, making it more predictable and easier to hit for the player. void SetTargetPositionOnCircle()
{ // Flying around in circle x += Time.deltaTime; z += Time.deltaTime; float currentOffsetX = (float) Math.Cos(x * circleMovementSpeed); float currentOffsetZ = (float) Math.Sin(z * circleMovementSpeed); currentOffset = new Vector3(currentOffsetX, 0, currentOffsetZ); targetPosition = centerPosition + currentOffset * circleRadius;
} void UpdatePositionUniformMovement()
{ Vector3 newPositionAfterUpdate = Vector3.MoveTowards(transform.position, targetPosition, maxDistanceDelta); movementThisUpdate = newPositionAfterUpdate - transform.position; transform.position = newPositionAfterUpdate;
} Attraction Spell The vision for an attraction spell I decided to go with can be described as a beam that slowly attracts the book towards its root, i.e. the staff's tip. The visual aspect of this spell is handled by attaching a long cylinder coming out of the staff's tip. Upon activation (while debugging the press of a button, later on a voice command), it turns visible and can interact with the book accordingly by changing its movement mode on overlap. To sell the impression of a beam pulling objects toward oneself, I created a scrolling shader using a mask. The result is a beam that is mostly seethrough with purple lines scrolling along the mesh toward the player, giving the impression of a pull-in effect. This shader, however, created some problems in virtual reality at first. More on that in a later section. To finish the effect, I added a fitting sound effect. Once the beam overlaps with the book, its movement mode is set to Attracted and its target position is updated to be around the base of the spell. This result in the book being drawn in towards the player as long as it is within the spell's hitbox. In case the player stops using the spell while the book is still being attracted or the books slips out of the beam, it slowly returns to its idle state. Grabbing Spell Once the book is close, the player is able to grab it using their grabbing spell. This creates a sphere attached to the staff's tip, that draws in the book upon contact. Visually, I reused the same approach as for the attraction spell, exchanging the cylindrical mesh with a sphere and using the same shader with a light blue color instead. Suprisingly, the scrolling shader with a slightly different mask fits the spell pretty well, as its semantic changes drastically when put onto a sphere, not conveying the feeling of movement like it does with a cylinder. Upon activation and overlap with the book, the book's target position is set to the sphere's center and its movement mode is set to Grabbed . This results in the book moving towards the sphere's center using spring behaviour, which means that it will follow the staff's movement organically by being pulled into the sphere's center, leading to occasional small overshoots. void UpdatePositionSpringMovement() { Vector3 displacement = targetPosition - transform.position; Vector3 springForce = stiffness * displacement; Vector3 dampingForce = damping * grabbedVelocity; Vector3 force = springForce - dampingForce; Vector3 acceleration = force; grabbedVelocity += acceleration * Time.deltaTime; transform.position += grabbedVelocity * Time.deltaTime; } Rotation Spell While the player is holding the book, they are able to activate the rotation spell. This locks the sphere and the book in place, enabling the player to rotate the book by moving the staff's tip in circles. To make the rotation as comfortable and intuitive as possible, I did not want the player to need to move the tip around the book to rotate it. Instead, one can imagine the player rotating the book by moving the staff's tip along a sphere's surface of which the center is defined as the player moves their staff: private Queue<Vector3> controllerPositions = new Queue<Vector3>(maxStoredControllerPositions);
private Vector3 meanControllerPosition;
private Vector3 lastControllerMeanDifference;
private Vector3 currentControllerMeanDifference; void LateUpdate()
{ // ... lastControllerMeanDifference = currentControllerMeanDifference; currentControllerMeanDifference = -meanControllerPosition + OVRInput.GetLocalControllerPosition(controller); // ...
} void UpdateControllerPositionQueue()
{ controllerPositions.Enqueue(OVRInput.GetLocalControllerPosition(controller)); if (controllerPositions.Count > 120) { controllerPositions.Dequeue(); }
} void UpdateMeanControllerPosition()
{ // Recalculate mean position of controller every update by converting Queue to Array. This is very inefficient and should be optimized by using the current meanControllePosition and the new position to update it without the O(n) conversion. // This optimization is for later though. Array controllerPositionsArray = controllerPositions.ToArray(); meanControllerPosition = controllerPositionsArray.OfType<Vector3>().Aggregate((acc, cur) => acc + cur) / controllerPositionsArray.Length;
} void RotateBook()
{ // Calculate rotation axis by looking at the unit circle around the mean controller position. // Use cross product of last update's position on unit circle and current position on unit circle. // Unity uses a left-handed coordinate system, so use previous position first in cross product. Vector3 previousPositionOnUnitCircle = lastControllerMeanDifference.normalized; Vector3 currentPositionOnUnitCircle = currentControllerMeanDifference.normalized; Vector3 rotationAxis = Vector3.Cross(previousPositionOnUnitCircle, currentPositionOnUnitCircle); // Calculate the angle of rotation float angle = Vector3.Angle(previousPositionOnUnitCircle, currentPositionOnUnitCircle); // Calculate quaternion from axis and angle targetAngleVelocity = Quaternion.AngleAxis(angle, rotationAxis).normalized; // Interrupt when player is not moving the controller for a longer period as the book would jitter and rotate uncontrollably. if (lastControllerMeanDifference.magnitude < 0.03 || currentControllerMeanDifference.magnitude < 0.03) { targetAngleVelocity = Quaternion.identity; } // Smoothly rotate the book by using a spring mechanism like with the book movement. currentAngleVelocity = Quaternion.Slerp(currentAngleVelocity, targetAngleVelocity, Time.deltaTime * rotationSpeed); float currentAngle = Quaternion.Angle(Quaternion.identity, currentAngleVelocity); if (currentAngle > maxRotationSpeed) { currentAngleVelocity = Quaternion.Slerp(Quaternion.identity, currentAngleVelocity, maxRotationSpeed / currentAngle); } // Rotate the book around the calculated axis by the calculated angle. FlyingBook.transform.Rotate(currentAngleVelocity.eulerAngles, Space.World);
} We calculate the mean of the controller positions, i.e. the positions of the staff's tip, of the past 120 updates by adding the positions to a queue each update, whose content is then summed up and divided by the queue's length. Once the mean is known, the axis of rotation to rotate the book around can be calculated using the controllers previous and current position. To calculate the axis of rotation, we project both the vector from mean to the controller position during the last update and the vector from mean to the controller position during the current update onto the unit sphere with the mean at its center by normalizing the vectors. By calculating their cross product, we get the axis of rotation around which the previous controller position would need to rotate around to get to the current controller position. Additionally, we use the angle between the two vectors to get the amount of rotation needed. Using the calculated axis of rotation and the angle, they can be applied to the book either directly to correspond directly to the controller movement, or, which is closer to the mechanic I envisioned, choose a more physically accurate approach by accounting for the book's drag, making the mechanic feel much more realistic and engaging. Trusty servant When looking at the default challenge, the player is supposed to grab a T shape and place it in a certain position with a given orientation. To do something similar with the book, the player is confronted with a translucent version of the book in a random orientation. As explained previously, one of your trusty skeletal servants appears, greeting you obediently using voice lines I recorded and edited in order to get a voice fitting to one such character. Once the player hovers the book over the correct spot using the magic, they can release it. If the book is near the servant's magical black sphere, they take over, which stops the book from return to its idle state like it would when releasing it somewhere else, but instead putting it into the finished state. Afterwards, the player is able to send the servant away using their voice to command them to leave. This ends the challenge, transforming the staff back into the broom, given the player time to "hop on". Depending on how accurate the player placed the book, they are credited a score depending on both position and orientation: manipulationError = Vector3.zero;
manipulationError += targetBook.transform.position - flyingBook.transform.position;
manipulationError += targetBook.transform.rotation.eulerAngles - flyingBook.transform.rotation.eulerAngles; As for the orientation, I am sure there are better meassures to fairly calculate a score, but for the purpose of this demo, this approach satisfies our needs. Voice Commands With all the spells set up and working, the only thing left is to add a way for the player to actually use them. As mentioned previously, using your voice to cast your arsenal of spells and command around your servant is fitting for the narrative and is thus the way to go. The most common way to setup voice control for VR applications in Unity with Meta headsets is using Wit AI , a web service provided by Meta that uses artificial intelligence in order to translate a user's voice input into text, which can be used to trigger certain events. For the details on how to use it, there are a couple of tutorials, which I have linked below. But to summarize, an app needs to be created on their website and connected to the game using a server access token . On the website, utterances are added, which are essentially the keywords and phrases that need to be said in order to trigger certain intents , which we can be listened to inside unity, triggering certain functions by adding a Voice Intent Controller . For my game, I want the player to cast the spells by saying their names using specific words. Below, a state machine illustrates what spells can be used when and what to say to activate them: ![](IARVR_assets/spell_state_machine.png) At first, I wanted the voice system to listen passively, which would mean that the player would simply have to say the keywords for the spells once they want to cast a spell. Unfortunately, I only found tutorials in which the player pushes a specified button to activate voice input. Once the assigned button is pressed, an activation function is called, starting interaction with the API in order to process the user's voice input. My initial plan was to let it listen passively by simply calling this activation function without the need to press a button, but instead upon challenge initiation. This approach, however, does not work whatsoever, as the app stops listening 20 seconds after the first volume threshold breach or after 2 seconds of silence. Alternatively, I tried listening to the voice recognition's deactivation event , which would immediately reactivate it again. Without a built-in delay, the activation would almost never be recognized by the API, unfortunately. When adding a small delay between deactivation and activation, the reactivation would work sometimes, but only very unreliably. Adding too small of a delay would mean that the voice recognition system could crash at any point without reliable means to recover, while adding too big of a delay could create big time periods in which the player could say something that would not get picked up on. Of course, simply calling the activation function every update did not help as well. Unfortunately, the voice control system by Meta using Wit.AI does not support passive listening, which makes sense as that would require us to constantly make API calls, which is would be very resource heavy for their service. I also did not find a way to create a self-hosting solution, although I did not look into it that much, as that would also remove portability, as other player's would have to be connected to my server. All things considered, I would need to introduce an activation button. With the current setup though, the only button that would not be too immersion breaking and awkward to activate would be the trigger on the left controller, if attached to the stick around where the player would grab the stick. So I added the left controller to the configuration in a place, where the player is able to press the button using their right middle finger for instance, which does not feel as weird as feared. Honestly, it does not feel immersion breaking, which I am glad for considering the lack of alternatives. So at last, the player is able to cast their spells by holding down the left trigger, saying the spell's name, and releasing the button again. As for the names of the spells, I kept it very simple, simply calling out what the spell does. Alternatively, spells could also be given fancy names, but I wanted to keep them simple in order for the player to memorize them better and also as complicated, self-engineered names might confuse the AI, leading to less responsive spell casting.

