To start off, I needed to replicate the stick built out of tools from my local hardware store in game by attaching a broomstick mesh to the right controller. This results in the broomstick following the controller's every movement, making them stick together just like in reality. Of course, proper adjustments would be required, but with a bit of moving around the mesh, it looks convincing enough for the player to believe they are holding the broomstick in their real hands. The chosen means of locomotion, which is shown and described at the end of the previous segment " Brainstorming ideas ", requires two important informations: The direction in which the broomstick points The angle between the player's upper body and the broomstick We can approximate the player's upper body using a line defined by two points: The VR headset's position and the player's "intersection" with the broom, i.e. their seating position. The player's seating position can be set multiple ways. One way would be to also attach the left controller to the stick around where the player would sit. However, especially with a seated experience, this poses problems since it would be in the way of the player when sitting down or leaning backward for instance. Another way, which I opted for, is to place an empty object within the broom to indicate the rough seating position. This allows us to calculate the necessary vectors using the right controller's position, which is near the tip of the stick, the seating position and the HMD's position as shown in the illustration above. Using the following code, we get the flying direction along with the player speed: public GameObject seatingPositionObject;
[SerializeField] private float speedMultiplier;
private Vector3 seatingPosition;
private Vector3 broomControllerPosition;
private Vector3 headPosition;
private Vector3 seatToHead;
private Vector3 seatToController;
private Vector3 movementDirection;
[SerializeField] private AnimationCurve speedAnimationCurve; void Update() { // Setting positions seatingPosition = seatingPositionObject.transform.position; broomControllerPosition = OVRInput.GetLocalControllerPosition(rightController) + transform.position; headPosition = hmd.transform.position; // Setting up essential vectors from seat to head and tip. // Normalize so upper body's size does not matter for acceleration // and speed stays independent of controller placement on broom seatToController = (broomControllerPosition - seatingPosition).normalized; seatToHead = (headPosition - seatingPosition).normalized; // speedValue depends on the orthogonal projection of seatToHead on seatToController movementDirection = seatToController; float dot_product = Vector3.Dot(seatToHead, seatToController); float speedValue = speedAnimationCurve.Evaluate(dot_product) * speedMultiplier * Time.deltaTime; transform.position = transform.position + movementDirection * speedValue; } Instead of calculating the exact angle, calculating the scalar product perfectly suits our needs, as the scalar product's mathematical properties already suits the intended behaviour: Being upright holds movement Leaning forward accelerates Leaning backward decelerates One important question remains: How exactly do we process this information? One way would be to build an acceleration system, which means that leaning would change the player's acceleration instead of changing the velocity directly. This system would also require a sort of drag so the player does not fly on forever when being upright. However, after playtesting I decided against this system for the simple reason that it makes controlling the broom much more difficult and frustrating. Instead, I opted for changing the velocity directly by using some sort of constant multiplier or, in the final version, a spline function. Using a spline, I was able to adjust the movement to feel better. I decided to adjust it a little so instead of linear growth, leaning only a little results in very little motion, but leaning far increases the velocity more. I feel like this is a good way of implementing the movement because, unlike in games using a controller or keyboard, the velocity is directly linked to the player's pose which cannot change too drastically, leading to more responsive gameplay. Also, I can imagine a magical flying broomstick does not really care about physical accuracy and can just change velocity as the flier wants it to!
